import React from "react";

function Product({photo,title,category}){
    return (
        <div>
            <img src={photo}/>
      
       <div className="bg-red-300 text-amber-900 text-lg">{title} {category}</div> 

       <div className="bg-gray-600 text-white">{category} </div>
       </div>
    );
}

export default Product;
